import React, { useState, useEffect } from 'react';

type Coordinate = {
    x: number;
    y: number;
  };

  // JSON データ全体を表す型
  type ImageData = {
    image1: string;
    image2: string;
    location: Coordinate;
    direction0: Coordinate;
    direction1: Coordinate;
    direction2: Coordinate;
    direction3: Coordinate;
  };
const DataDisplay: React.FC = () => {
  const [data, setData] = useState<ImageData>({ image1: '', image: '' });

  useEffect(() => {
    fetch('pseudo_data.json')
      .then(response => response.json())
      .then(data => setData(data))
      .catch(error => console.error('Error loading the data:', error));
  }, []);

  return (
    <div>
      <h1>{data.text}</h1>
      <img src={data.image} alt="Loaded from JSON" />
    </div>
  );
};

export default DataDisplay;
